function getBotResponse(text) {
  botResponse = `<img class="botAvatar" src="`+bot_avatar_default+`"/><span class="botMsg">${text}</span><div class="clearfix"></div>`;
  return botResponse;
}

function setBotResponse(response,message="") {
  setTimeout(() => {
    hideBotTyping();
    if (response.length < 1) {
      const fallbackMsg = "I am facing some issues, please try again later!!!";
      const BotResponse = `<img class="botAvatar" src="`+bot_avatar_default+`"/><p class="botMsg">${fallbackMsg}</p><div class="clearfix"></div>`;
      $(BotResponse).appendTo(".chats").hide().fadeIn(1000);
      scrollToBottomOfResults();
    } else {
		console.log("Response from Rasa: ", response, "\nStatus: ", status);
      for (let i = 0; i < response.length; i += 1) {
        if (Object.hasOwnProperty.call(response[i], "text")) {
          if (response[i].text != null) {
            let botResponse;
            let html = converter.makeHtml(response[i].text);
            //console.log("Response from Rasa: ", html, "\nStatus: ", status);
            html = html
              .replaceAll("<p>", "")
              .replaceAll("</p>", "")
              .replaceAll("<strong>", "<b>")
              .replaceAll("</strong>", "</b>");
            html = html.replace(/(?:\r\n|\r|\n)/g, "<br>");
            //console.log("Response from Rasa: ", html, "\nStatus: ", status);
            //console.log(html);
            // check for blockquotes
            if (html.includes("<blockquote>")) {
              html = html.replaceAll("<br>", "");
              botResponse = getBotResponse(html);
            }
            if (html.includes("<b>")) {
              //html = html.replaceAll("<br>", "");
              botResponse = getBotResponse(html);
            }
            // check for image
            if (html.includes("<img")) {
              html = html.replaceAll("<img", '<img class="imgcard_mrkdwn" ');
              botResponse = getBotResponse(html);
            }
            // check for preformatted text
            if (html.includes("<pre") || html.includes("<code>")) {
              botResponse = getBotResponse(html);
            }
            // check for list text
            if (
              html.includes("<ul") ||
              html.includes("<ol") ||
              html.includes("<li") ||
              html.includes("<h3") 
            ) 
            {
              //html = html.replaceAll("<br>", "");
              // botResponse = `<img class="botAvatar" src="./static/img/sara_avatar.png"/><span class="botMsg">${html}</span><div class="clearfix"></div>`;
              botResponse = getBotResponse(html);
            } 
            else {
              // if no markdown formatting found, render the text as it is.
              if (!botResponse) {
                botResponse = `<img class="botAvatar" src="${bot_avatar_default}"/><p class="botMsg">${response[i].text}</p><div class="clearfix"></div>`;
              }
            }
            // append the bot response on to the chat screen
            $(botResponse).appendTo(".chats").hide().fadeIn(1000);
          }
        }
        // check if the response contains "buttons"
        if (Object.hasOwnProperty.call(response[i], "buttons")) {
          if (response[i].buttons.length > 0) {
            addSuggestion(response[i].buttons);
          }
        }
        // check if the response contains "images"
        if (Object.hasOwnProperty.call(response[i], "image")) {
          if (response[i].image !== null) {
            const BotResponse = `<div class="singleCard"><img class="imgcard" src="${response[i].image}"></div><div class="clearfix">`;

            $(BotResponse).appendTo(".chats").hide().fadeIn(1000);
          }
        }
        // check if the response contains "attachment"
        if (Object.hasOwnProperty.call(response[i], "attachment")) {
          if (response[i].attachment != null) {
            if (response[i].attachment.type === "video") {
              // check if the attachment type is "video"
              const video_url = response[i].attachment.payload.src;

              const BotResponse = `<div class="video-container"> <iframe src="${video_url}" frameborder="0" allowfullscreen></iframe> </div>`;
              $(BotResponse).appendTo(".chats").hide().fadeIn(1000);
            }
          }
        }
        // check if the response contains "custom" message
        if (Object.hasOwnProperty.call(response[i], "custom")) {
          if (Object.hasOwnProperty.call(response[i].custom, "cache")) 
          {
            cache = response[i].custom.cache;
            if(cache == false)
            {
              cacheResponse= {};
            }
          }
          const { payload } = response[i].custom;
          if (payload === "quickReplies") {
            // check if the custom payload type is "quickReplies"
            const quickRepliesData = response[i].custom.data;
            showQuickReplies(quickRepliesData);
            return;
          }
          // check if the response contains "buttons"
          if (payload === "buttonList") {
            const buttonsData = response[i].custom.data;
            if (Object.hasOwnProperty.call(response[i].custom, "cache")) 
            {
              cache = response[i].custom.cache
              if(cache == true)
              {
                cacheResponse[message] = {"payload":"buttonList", "data":buttonsData};
              }
            }
            sub_text = "";
            if (Object.hasOwnProperty.call(response[i].custom, "text")) 
            {
              sub_text = response[i].custom.text;
            }
            addSuggestion(buttonsData,sub_text);
          }
          // check if the response contains "contact_info"
          if (payload === "contact_info") {
            const contactData = response[i].custom.data;
            if (Object.hasOwnProperty.call(response[i].custom, "cache")) 
            {
              cache = response[i].custom.cache
              if(cache == true)
              {
                cacheResponse[message] = {"payload":"contact_info", "data":contactData};
              }
            }
            addContactInfo(contactData);
          }
          // check if the response contains "yesnoblock"
          if (payload === "yesnoblock") {
            const contactData = response[i].custom.data;
            if (Object.hasOwnProperty.call(response[i].custom, "cache")) 
            {
              cache = response[i].custom.cache
              if(cache == true)
              {
                cacheResponse[message] = {"payload":"yesnoblock", "data":contactData};
              }
            }
            addYesNoBlock(contactData);
          }
          // check if the custom payload type is "pdf_attachment"
          if (payload === "pdf_attachment") {
            renderPdfAttachment(response[i]);
            return;
          }
		  
          if (payload === "openlink") {
            window.open(dropDownData = response[i].custom.data, '_blank');
            return;
          }

          // check if the custom payload type is "dropDown"
          if (payload === "dropDown") {
            const dropDownData = response[i].custom.data;
            renderDropDwon(dropDownData);
            return;
          }

          // check if the custom payload type is "location"
          if (payload === "location") {
            $("#userInput").prop("disabled", true);
            getLocation();
            scrollToBottomOfResults();
            return;
          }

          // check if the custom payload type is "cardsCarousel"
          if (payload === "cardsCarousel") {
            const cardsCarouselData = response[i].custom.data;
            if (Object.hasOwnProperty.call(response[i].custom, "cache")) 
            {
              cache = response[i].custom.cache
              if(cache == true)
              {
                cacheResponse[message] = {"payload":"cardsCarousel", "data":cardsCarouselData};
              }
            }
            showCardsCarousel(cardsCarouselData);
            //return;
          }

          // check if the custom payload type is "chart"
          if (payload === "chart") {
            const chartData = response[i].custom.data;
            const {
              title,
              labels,
              backgroundColor,
              chartsData,
              chartType,
              displayLegend,
            } = chartData;
			
            // pass the above variable to createChart function
            createChart(
              title,
              labels,
              backgroundColor,
              chartsData,
              chartType,
              displayLegend,
              i
            );
            //alert(title)
            scrollToBottomOfResults();
                  // on click of expand button, render the chart in the charts modal
                  $(document).on("click", "#expand", () => {
              if (typeof modalChart !== "undefined") {
              modalChart.destroy();
              }
              createChartinModal(
                title,
                labels,
                backgroundColor,
                chartsData,
                chartType,
                displayLegend
              );
            });
            //return;
          }

          // check of the custom payload type is "collapsible"
          if (payload === "collapsible") {
            const { data } = response[i].custom;
            // pass the data variable to createCollapsible function
            createCollapsible(data);
          }
        }
      }
      scrollToBottomOfResults();
    }
    $(".usrInput").focus();
  }, 500);
}
firstBack = true;
async function send(message) {
	if(message == "backhistory" && historyAction.length > 0)
	{
		if(firstBack) 
		{
			historyAction.pop();
			firstBack = false;
		}
		message = historyAction.pop();
	}
	else
	{
		if(message == "backhistory")
		{
			message = initAction;
		}
		else historyAction.push(message);
		firstBack = true;
	}
	
	scrollToBottomOfResults();
	if(cacheResponse[message] != undefined)
	{
	   if(cacheResponse[message]['payload'] == "cardsCarousel")
	   {
			showCardsCarousel(cacheResponse[message]["data"]);
	   }
	   else if(cacheResponse[message]['payload'] == "buttonList")
	   {
		   addSuggestion(cacheResponse[message]["data"]);
	   }
	   else if(cacheResponse[message]['payload'] == "contact_info")
	   {
		   addContactInfo(cacheResponse[message]["data"]);
	   }
     else if(cacheResponse[message]['payload'] == "yesnoblock")
	   {
		   addYesNoBlock(cacheResponse[message]["data"]);
	   }
	   scrollToBottomOfResults();
	   hideBotTyping();
	   return;
	}

	await new Promise((r) => setTimeout(r, 2000));
	$.ajax({
		url: rasa_server_url,
		type: "POST",
		contentType: "application/json",
		data: JSON.stringify({ message, sender: sender_id }),
		success(botResponse, status) {
			console.log("Response from Rasa: ", botResponse, "\nStatus: ", status);
			if (message.toLowerCase().includes(initAction) && use_livechat != "") {
				$("#userInput").prop("disabled", true);
			//return;
			}
			if (use_livechat != "" && message.toLowerCase().includes(use_livechat)) {
				$("#userInput").prop("disabled", false);
				$("#userInput").focus();
			}
			
			setBotResponse(botResponse,message);
		},
		error(xhr, textStatus) {
			if (message.toLowerCase() === initAction) {
			$("#userInput").prop("disabled", true);
			}
			setBotResponse("","");
			console.log("Error from bot end: ", textStatus);
		}
	});
}

function restartConversation() {
  $("#userInput").prop("disabled", true);
  // destroy the existing chart
  $(".collapsible").remove();
  cacheResponse = {}
  if (typeof chatChart !== "undefined") {
    
	for (const item of chatChart) { // You can use `let` instead of `const` if you like
		item.destroy();
	}
  }

  $(".chart-container").remove();
  if (typeof modalChart !== "undefined") {
    modalChart.destroy();
  }
  $(".chats").html("");
  $("#usrInput").val("");
  send("/wellcome{'language':"+defaultLanguage+"}");
  //$("#userInput").prop("disabled", false);
}
